import React from 'react';
import './styles.css';
import Buttons from './Buttons'

function MainContent() {
    return (
        <div className="background">
            <Buttons />
        <div className="main">
            <h1>Explore Scratch blocks</h1>
            <p>Learn the basic function of some basic scratch blocks such as "say", "wait", "go to" and Control Blocks</p>
        </div>
        </div>

    );
}

export default MainContent;
